import React from 'react';

class Nav extends React.Component {
    render(){
        return(
            <div>

<ul class="sidenav">
    <li class=""><a data-toggle="tab" href="#menu0" class="glyphicon glyphicon-home" aria-expanded="false">Dashboard</a></li>
    <li class="">
                        <a data-toggle="tab" href="#menu1" class="glyphicon glyphicon-user" aria-expanded="false">Create-Role</a></li>
                        <li class=""><a data-toggle="tab" href="#menu2" class="glyphicon glyphicon-list" aria-expanded="false">Manage-Users</a></li>
                        <li class="active"><a data-toggle="tab" href="#menu3" class="glyphicon glyphicon-list-alt" aria-expanded="true">Reconcile</a></li>
                        <li class=""><a data-toggle="tab" href="#menu4" class="glyphicon glyphicon-briefcase" aria-expanded="false">Upload</a></li>
                        <li class=""><a data-toggle="tab" href="#menu5" class="glyphicon glyphicon-tasks" aria-expanded="false">User-Management</a></li>
                        <li class=""><a data-toggle="tab" href="#menu6" class="glyphicon glyphicon-transfer" aria-expanded="false">Warehouse-Management</a></li>
                        <li><a href="login.html"><i class="glyphicon glyphicon-log-out" aria-hidden="true"></i>Logout</a></li>
  <a href="#about">About</a>
  <a href="#services">Services</a>
  <a href="#clients">Clients</a>
  <a href="#contact">Contact</a>--->
 </ul>
            </div>

        );
    }
}


export default Nav;
